import axiosInstance from "./axiosInstance";

// `personelSicilNo`'yu bir parametre olarak al
export const updatePersonel = (personelSicilNo, personelData) => {
  return axiosInstance.put(`/personel/${personelSicilNo}/update`, personelData);
};

export const deletePersonel = (personelSicilNo) => {
  return axiosInstance.delete(`/personel/${personelSicilNo}/delete`);
};

export const getOnePersonel = (personelSicilNo) => {
  return axiosInstance.get(`/personel/${personelSicilNo}`);
};

export const getPersonel = () => {
  return axiosInstance.get('/personel');
};
